        array('id' => 'd976e1d4-08fd-11ef-a6cd-a44cc8213838','coopId' => '207','loanAmount' => '3000000','loanDate' => '2023-01-12','guarantor1' => '30','guarantor2' => '25','guarantor3' => NULL,'guarantor4' => NULL,'status' => '1','userId' => '6','repaymentDate' => NULL,'created_at' => NULL,'updated_at' => NULL)
      );
      set_time_limit(300);

      foreach ($previous_loans as $loan) {
        if($loan['coopId'] == null || empty($loan['coopId']))
          continue;
        
        $existLoan = LoanCapture::where('coopId', $loan['coopId'])->first();

        // if exists, update the details
        if($existLoan)
        {
          $existLoan->update([
            'loanAmount' => $loan['loanAmount'],
            'loanDate' => $loan['loanDate'],
            'guarantor1' => $this->checkIfMemberExists($loan['guarantor1']) ? $loan['guarantor1'] : $loan['coopId'],
            'guarantor2' => $this->otherGuarantorCheckNullorFilter($loan['guarantor2']),
            'guarantor3' => $this->otherGuarantorCheckNullorFilter($loan['guarantor3']),
            'guarantor4' => $this->otherGuarantorCheckNullorFilter($loan['guarantor4']),
            'status' => $loan['status'],
            'repaymentDate' => date('Y-m-d', strtotime($loan['loanDate']. ' + 540 days'))
          ]);

          // search in ActiveLoan and update
          $act = ActiveLoans::where('coopId', $loan['coopId'])->first();
          if($act){
            $act->update([
              'loanAmount' => $loan['loanAmount'],
              'loanBalance' => $loan['loanAmount'],
              'loanDate' => $loan['loanDate'],
              'repaymentDate' => date('Y-m-d', strtotime($loan['loanDate']. ' + 540 days')),
              'lastPaymentDate' => $loan['loanDate']
            ]);
          } else {
            if($existLoan->status == 1)
              $existLoan->scopeAddToActiveLoanWithDate();
          }

        } else {
          // check if member with coopId exists
          $member = $this->checkIfMemberExists($loan['coopId']);
          if(!$member)
            continue;

          $g1 = null;
          
          if($loan['guarantor1'] == null || empty($loan['guarantor1']))
          {
            $g1 = $loan['coopId'];
          }else {
            // check for guarantor 1 and if exists
            $guarantor1 = $this->checkIfMemberExists($loan['guarantor1']);
            if($guarantor1)
              $g1 = $loan['guarantor1'];
            else
              $g1 = $loan['coopId'];
          }
          
          
          $loanC = LoanCapture::create([
            'id' => $loan['id'],
            'coopId' => $loan['coopId'],
            'loanAmount' => $loan['loanAmount'],
            'loanDate' => $loan['loanDate'],
            'guarantor1' => $g1,
            'guarantor2' => $this->otherGuarantorCheckNullorFilter($loan['guarantor2']),
            'guarantor3' => $this->otherGuarantorCheckNullorFilter($loan['guarantor3']),
            'guarantor4' => $this->otherGuarantorCheckNullorFilter($loan['guarantor4']),
            'status' => $loan['status'],
            'userId' => auth('admin')->user()->id,
            'repaymentDate' => date('Y-m-d', strtotime($loan['loanDate']. ' + 540 days'))
          ]);
  
          if(!$loanC)
            throw new Exception("Error Processing Loan Request into db", 1);
              
          try {
            if($loanC->status == 1)
              $loanC->scopeAddToActiveLoanWithDate();
          } catch (Exception $th) {
              throw new Exception("Error Processing Loan Request: ". $th->getMessage(), 1);
              
          }
        }

        
      }
      // {{-- end --}}
    }

    public function checkIfMemberExists($coopId)
    {
      $member = Member::where('coopId', $coopId)->first();
      if(!$member)
        return false;
      return true;
    }

    public function otherGuarantorCheckNullorFilter($guarantor)
    {
        $g0 = null;
          
          if($guarantor == null || empty($guarantor))
          {
            $g0 = null;
          }else {
            // check for guarantor 1 and if exists
            $guarantor1 = $this->checkIfMemberExists($guarantor);
            if($guarantor1)
              $g0 = $guarantor;
          }

      return $g0;
    }
